"""
Write a function to find the longest common prefix string amongst an array of strings.

If there is no common prefix, return an empty string ""

Input: ["flower","flow","flight"]
Output: "fl"

Input: ["dog","racecar","car"]
Output: ""
Explanation: There is no common prefix among the input strings.


异常情况：有['']或者[]时
其他
    找出最短的单词，因为最长的前缀最长只能跟最短的单词一样长
    然后遍历每个单词，把每个单词的每一位和最短单词的每一位相比较
        如果相等，继续比，
        如果不相等，则已找到当前单词和最短单词的公共前缀
        找出每个单词于最短单词的公共前缀，然后取最短的那个
"""

class Solution(object):
    def longestCommonPrefix(self, strs):
        """
        :type strs: List[str]
        :rtype: str
        """
        prefix = " "*10000000
        if not strs or '' in strs: return "" #输入 []和['']时，直接返回'
        shortest = min(strs, key=len)
        #先遍历，每个单词
        for key,val in enumerate(strs): # 遍历 flower  flow等
            tmp = shortest
            for i in range(len(shortest)): # f l o w
                if val[i] != shortest[i]:
                    tmp = shortest[:i]
                    break
            if len(tmp) < len(prefix): prefix = tmp
        return prefix

    """
    https://leetcode.com/problems/longest-common-prefix/discuss/6918/Short-Python-Solution
    思路刚好跟我的相反
    首先也是找到最短的单词
    然后遍历这个单词的每一个字母，再与其他的单词的对应位相比

    """
    def longestCommonPrefix_2(self,strs):
        if not strs:
            return ""
        shortest = min(strs,key=len)
        for i, ch in enumerate(shortest):
            for other in strs:
                if other[i] != ch:
                    return shortest[:i]
        return shortest        

